  root: {
    display: 'flex',
    flexDirection: 'column'
  },
  img: {
    width: '100%'
  },
  title: {

  }
}));

const AddDatasource = ({ img, modal }) => {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <div className={classes.img}>
        <img src={require('../../static/db_mssql.png')} alt="MsSQL" />
      </div>

    </Card>
  )
}


export default AddDatasource;
